import React from "react";
import Experience from "./Experience";

function Education(){
    return(
        <>
            <div className="skills">
                <ul>
                    <li>HTML</li>
                    <li>CSS</li>
                    <li>JavaScript</li>
                    <li>BootStrap</li>
                    <li>Reactjs</li>
                    <li>Nodejs</li>
                    <li>MySQL</li>
                    <li>MongoDB</li>
                </ul>
            </div>
        </>
    )
}

export default Education;
